import './App.css';

const App = () => {
  return (
    <div className="App">

      <p>Hello World</p>
      <ul>
        <li> Ilyas </li>
        <li> Ilyas2 </li>
        <li> Ilyas3 </li>
        <li> Ilyas4 </li>
      </ul>
    </div>
  );
}

export default App;
